- Motivate members of the board to achieve desired goals.', 'contributors': [{'type': 'standardizedContributor', 'first_name': 'Annalisa', 'last_name': 'Fiorillo', 'name': None, 'headline': 'IT ‚ÜîÔ∏è CH ‚ÜîÔ∏è EN ‚ÜîÔ∏è IT Interpretation & Translation | China Specialist | Digital Marketing | Cross Border E-Commerce | Business Development | Avid Learner | Personal Growth | Mens Sana in Corpore Sano'}]}, {'title': '"The role of the interpreter in Italian companies based in China"  Master‚Äôs Degree thesis', 'date': {'start': {'month': 7, 'day': None, 'year': 2013}, 'end': {'month': 3, 'day': None, 'year': 2014}}, 'description': 'My thesis is about the role of the interpreter in Italian companies based in China. It aims to demonstrate that whoever is willing to do business in China should not under-evaluate the benefits of interpretation services and a good knowledge of the Chinese culture. 

My intent is not simply to emphasize the important role of the interpreter within Italian companies working in China. What I hope to achieve is to make clear to Italian entrepreneurs who wants to have success in China that they need to focus on the approach, here is why: Italians and Chinese think in a different way, act in a different way, solve problems in a different way, they have different values. In order to get the right approach they need to work on cultural aspects, meaning that whoever wants to do business in China should attend brainstorming classes on the Chinese culture and the omnipotent cultural gap so that they can understand what they are going to face once they arrive in China. Most importantly, an interpreter should work with them within the company. It will make the difference. This way there will not be any misunderstands or waste of time at work, nobody will be disappointed and the communication will be incredibly smooth. It means good results for the company and a better working environment for both Italians and Chinese.
', 'contributors': [{'type': 'standardizedContributor', 'first_name': 'Annalisa', 'last_name': 'Fiorillo', 'name': None, 'headline': 'IT ‚ÜîÔ∏è CH ‚ÜîÔ∏è EN ‚ÜîÔ∏è IT Interpretation & Translation | China Specialist | Digital Marketing | Cross Border E-Commerce | Business Development | Avid Learner | Personal Growth | Mens Sana in Corpore Sano'}]}]

